        <meta itemprop=""name"" content=""Phân biệt mã code phân phối và mã sản xuất vợt cầu lông, bạn đã từng bị nhầm?"">
    </div>
    <div class=""row"">
        <div class=""col-md-12"">
            <h1 class=""title-head"">Phân biệt mã code phân phối và mã sản xuất vợt cầu lông, bạn đã từng bị nhầm?</h1>
            <div class=""postby"">
                <span>Đăng lúc 30-07-2018 09:22:45</span>
            </div>
            <div class=""article-details"">
                <div class=""article-content"">
                    <div class=""rte"">
                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">Khá nhiều bạn mới chơi cầu lông và nhiều bạn chơi lâu năm vẫn thường hay bị nhầm mã code phân phối và mã sản xuất vợt cầu lông. Bài viết này sẽ giúp bạn giải đáp thắc mắc đó một lần và mãi mãi.</span></p>

                        <p style=""text-align:justify""><span style=""font-f");
            WriteLiteral(@"amily:arial,helvetica,sans-serif; font-size:12pt"">Trước tiên, các bạn có thể theo dõi video về quy trình sản xuất vợt cầu lông của Yonex. Đây là một nhà máy sản xuất vợt Yonex cao cấp tại Nhật Bản.</span></p>

                        <p style=""text-align:center""><iframe allowfullscreen=""allowfullscreen"" frameborder=""0"" height=""315"" src=""https://www.youtube.com/embed/AeCakUK_1Js"" width=""560""></iframe></p>

                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">Trong video, chúng ta có thể thấy qua nhiều khâu sản xuất và kiểm tra nghiêm ngoặt sẽ cho ra vợt phôi Yonex. Sau đó mới dùng phôi này để sơn, khắc số serie cũng như số code phân phối, nơi sản xuất...</span></p>

                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt""><strong>* Về số mã code trên vợt. Thứ tự số seri có dạng XX MM YA BB được quy định cụ thể như sau:</strong></span></p>

                        <p st");
            WriteLiteral(@"yle=""text-align:justify"">
                            <span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">– XX là ngày sản xuất ra cây vợt được quy định theo tháng (1-31)</span><br>
                            <span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">– MM là tháng sản xuất vợt (1-12)</span><br>
                            <span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">– Y là năm sản xuất vợt (0-9)</span><br>
                            <span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">– A là số lô hàng mà Yonex sản xuất ra.</span><br>
                            <span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">– BB là mã phân phối cho các thị trường thế giới như: JP – Japan – Nhật Bản, TH – Thailand – Thái Lan, SP – Singapore, TW – Taiwan, IP – Internantionnal Player (mã dành cho các vận động viên chuyên nghiệp), CA – Canada…</span>
                        </p>

                        <p style=""t");
            WriteLiteral(@"ext-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">- Một lưu ý nhỏ nhưng mọi người ít chú ý, các mã code trên vợt chỉ là mã phân phối thị trường chứ không phải nơi sản xuất, các dòng vợt Yonex đời cao đều được sản xuất tại Nhật Bản. Ví dụ như vợt đó được bán tại Singapore, Nhật Bản hay Thái Lan...</span></p>

                        <p style=""text-align:center"">
                            <span style=""color:#0000ff; font-family:arial,helvetica,sans-serif; font-size:12pt""><img alt="""" src=""/img/full/content/images/uploaded/vot-cau-long/cach-phan-biet-ma-code-phan-phoi-voi-ma-xuat-xu -1.jpg"" style=""width:350px""></span><br>
                            <span style=""color:#0000ff; font-family:arial,helvetica,sans-serif; font-size:12pt"">Mã code phân phối trên vợt cao cấp Yonex. Ảnh: Internet.</span>
                        </p>

                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">Mã SP: Mã này được phâ");
            WriteLiteral(@"n phối bởi công ty Sunrise có trụ sở tại Singapore nên trên vợt có dán thêm tem của Sunrise có hình kiểu như con bướm óng ánh. Ngoài ra mã SP có thêm biểu tượng PBSI đặc trưng gồm 2 bông lúa, bên trái màu vàng, bên phải màu trắng (nếu cả 2 trắng là vợt fake). Mã SP Quốc tế thì chỉ có tem Yonex và biểu tượng bông lúa PBSI, còn mã SP ở VN thì có thêm tem của nhà phân phối và tem Bộ Công An.</span></p>

                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">Mã JP (hiện đã thay bằng XF): Mã JP có đặc điểm là có chữ S chiện cạnh chỗ ghi U G và đặc biệt thông số tension (sức căng) chỉ được ghi thông số lbs mà không quy đổi ra kg như các mã khác (đây cũng là dấu hiệu để phân biệt mã JP fake).</span></p>

                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">Mã TH thì đa số là đặc điểm chung và chỗ seal dán thêm 1 giấy tiếng Thái, phiếu bảo hành tiếng Thái, Mã TW tương tự chỉ kh");
            WriteLiteral(@"ác mã và phiếu bảo hành tiếng Trung.</span></p>

                        <p style=""text-align:justify""><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">* Về Nơi sản xuất: Hiện vợt Yonex sản xuất ở 3 nước là Nhật Bản cho các dòng vợt cao cấp, Đài Loan các dòng trung cấp và Trung Quốc các dòng cơ bản. Nơi sản xuất được ký hiệu bằng chữ ""Made in..."" trên thân vợt.</span></p>

                        <p style=""text-align:center"">
                            <span style=""color:#0000ff; font-family:arial,helvetica,sans-serif; font-size:12pt""><img alt="""" src=""/img/full/content/images/uploaded/vot-cau-long/cach-phan-biet-ma-code-phan-phoi-voi-ma-xuat-xu -2.jpg"" style=""height:197px; width:350px""></span><br>
                            <span style=""color:#0000ff; font-family:arial,helvetica,sans-serif; font-size:12pt"">Nơi sản xuất vợt được thể hiện bằng ""Made in..."" ở nắp chụp vợt dưới. Ảnh: Internet.</span>
                        </p>

                        <p style=""text-align:justify""");
            WriteLiteral(@"><span style=""font-family:arial,helvetica,sans-serif; font-size:12pt"">Do đó, nếu bạn thấy trên một cây vợt có mã là SP nhưng Made in China thì cũng đường bấn loạn nhé. Thật chất đây là cây vợt tầm thấp được sản xuất tại Trung Quốc nhưng phân phối ở Singapo mà thôi. Đến đây ắt hẳn bạn đã có thể tự giải đáp về cách phân biệt mã code phân phối và mã sản xuất vợt cầu lông rồi đó.</span></p>

